import { jsPDF } from "jspdf";

export default function GeneratePdf({ name, req } : { name: string; req: string; }) {
    const doc = new jsPDF({
        orientation: "landscape",
        unit: "in",
        format: [10, 7]
    });
    // {
    //     orientation: "landscape",
    //     unit: "in",    
    //     format: [10, 7],
    //     encoding: "windows-1254"
    // }

    var imageData = " data:image/jpeg;base64,"

    
    
    doc.setFont('Times New Roman');
    
    doc.setFontSize(64);

    var newName = ""
    for (let index = 0; index < name.length; index++) {
        var element = name[index];
        if (element == "ğ") {
            element = "g"
        }   
        else if (element == "Ğ") {
            element = "G"
        }
        else if (element == "ı") {
            element = "i"
        }
        else if (element == 'İ') {
            element = "I"
        }
        else if (element == "Ş") {
            element = "S";
        }
        else if (element == "ş") {
            element = "s"
        }
        else if (element == "ü") {
            element = "u"
        }
        else if (element == "Ü") {
            element = "U"
        }
        else if (element == "ö") {
            element = "o"
        }
        else if (element == "Ö") {
            element = "O"
        }
        else if (element == "Ç") {
            element = "C"
        }
        else if (element == "ç") {
            element = "c"
        }
        newName += element;
    }

    var text = newName;

    var textWidth = doc.getTextDimensions(text).w;
    var centerX = doc.internal.pageSize.getWidth() / 2;
    var centerY = doc.internal.pageSize.getHeight() / 2;
    var textX = centerX - (textWidth / 2);
    var textY = centerY;

    doc.addImage(imageData, "JPEG", 0,0, 10, 7);
    
    doc.text(text, textX, textY + 0.8);

    switch (req) {
        case "output":
            return doc.output('blob');
            break;
        case "save":
            doc.save(`iss_certificate_${name}.pdf`);
            break;
        default:
            break;
    }
}
